import React from "react";
import { Box, Heading, Flex, Text, Button, Image, ThemeProvider,Link } from "@chakra-ui/react";
import cinematesLogo from '../Assets/CinematesLogo.svg'; 

const NavLink = ({ children, ...props }) => (
    <Link px={2} color="white" {...props}>
      {children}
    </Link>
  );

  function Navbar() {
    return (
      <ThemeProvider>
        <Flex
          bg="white"
          w="100%"
          px={5}
          py={4}
          justifyContent="space-between"
          alignItems="center"
        >
          <Flex flexDirection="row" justifyContent="center" alignItems="center">
          <img src = {cinematesLogo}  style= {{height: "auto", width:"40%"}} /> 
          </Flex>
          <Box>
            <NavLink style ={{color:"#14213D"}}>Home</NavLink>
            <NavLink style ={{color:"#14213D"}}>Search</NavLink>
            <NavLink style ={{color:"#14213D"}}>Top Charts</NavLink>
            <NavLink style ={{color:"#14213D"}}>Reviews</NavLink>
            <NavLink style ={{color:"#14213D"}}>My Profile</NavLink>
          </Box>
        </Flex>
      </ThemeProvider>
    );
  }

  export default Navbar
